import React, { Component, Fragment } from 'react';
import MuiThemeProvider from '@material-ui/core/styles/MuiThemeProvider';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';

export default class PatientSymptomsProfile extends Component {

    back = (e) => {
        e.preventDefault();
        this.props.previousStep();
    }

    continue = (e) => {
        e.preventDefault();
        this.props.nextStep();
    }

    render() {
        const {handleChange, values} = this.props;

        return (
            <MuiThemeProvider>
                <Fragment>
                    <TextField 
                        placeholder = "Enter symptom parameter 1"
                        label = "Symptom parameter 1"
                        onChange = {handleChange}
                        defaultValue = {values.symptomParameter1}
                    />
                    <br />
                    <TextField 
                        placeholder =""
                        label = "Symptom parameter 2"
                        onChange= {handleChange}
                        defaultValue = {values.symptomParameter2}
                    />
                    <br />
                    <TextField 
                        placeholder = ""
                        label = "Symptom parameter 3"
                        onChange ={handleChange}
                        defaultValue = {values.symptomParameter3}
                    />
                    <br />
                    <Button
                        color = "secondary"
                        variant ="contained"
                        onClick ={this.back} 
                    >Back</Button>
                    <Button
                        color = "primary"
                        variant ="contained"
                        onClick ={this.continue} 
                    >Submit</Button>

                </Fragment>
            </MuiThemeProvider>

        )
    }

}
